import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from "react-router-dom";

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const movimentar = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };

    return (
        <li className="list-group-item d-flex justify-content-between align-items-center">
            <div>
                <span className="font-weight-bold">Código EAN:</span> {produto.id}<br />
                <span className="font-weight-bold">Nome:</span> {produto.nome}<br />
                <span className="font-weight-bold">Preço:</span> R${produto.preco} <br />
                <span className="font-weight-bold">Categoria:</span> {produto.categoria} <br />
                <span className="font-weight-bold">Quantidade:</span> {produto.quantidade}
            </div>
            <button className="btn btn-primary" onClick={movimentar}>Movimentar</button>
        </li>
    );
}
